('2369','18','7891','Villa Torres',Null,'Meerblick Villa mit sep. Gästeapartment in Capdepera','33348','Capdepera liegt an der  Nord Ostküste von Mallorca nur wenige km von Artà und Cala Ratjada entfernt. Die Villa steht auf einem ca 870m² großen Grundstück mit sehr schönem Blick auf die Cala n´Aldern. Die ca 520m² Wohnfläche verteilt sich auf 3 Etagen. Im Haupthaus befinden sich ein Wohn-Esszimmer, Küche, 5 Schlafzimmer 4 Badezimmer. Über die Gartenebene erreicht man ein separates Gästeapartment mit Wohn-Esszimmer, Küche, 3 Schlafzimmer und ein Badezimmer. Zur sehr guten Ausstattung gehören u.a Holz-Doppelglasfenster, Einbauküche und eine Fußbodenheizung (neuere Wärmepumpe). Im sehr schönen mediterranen angelegten Garten befindet sich ein Pool. Das sehr gepflegte Haus kann möbliert übernommen werden','33349','1350000','106','2015-08-31 10:55:36','106','2015-08-31 10:55:59',Null,'2457','70','1153',1,'1','0',Null,Null,Null,'33350',Null,'0','0','0',Null,'2015-08-31 10:59:05',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33351',Null,'33352',Null,'33353',Null,'33354',Null,'33355','0',0,'4');
